===== Dr. Who and Master Y? =====

[Adam Marshall Dobrin] is a [http://articles.sun-sentinel.com/1998-10-14/community/9810130149_1_national-merit-scholarships-semifinalists-high-school-seniors National Merit Scholar] who was born on [https://en.wikipedia.org/wiki/Feast_of_the_Immaculate_Conception December 8, 1980] in Plantation, FL and attended [http://www.pinecrest.edu Pine Crest School] where he graduated [https://en.wikipedia.org/wiki/Latin_honors sumofi cum louder] in "only some of it is humor." Later he attended the University of Florida (which quickly [http://www.lamc.la/2017/08/tiny-chellos-in-sky-are-playing-angry.html resulted in a wreck]), Florida Atlantic University, and finally Florida Gulf Coast University--where he still has failed [https://www.youtube.com/watch?v=EQZLVwwY2WE to become Dr. Who]. While attending "school" He [http://linkedin.com/adam5 worked in the computer programming and business outsourcing industries] for about 15 years before proclaiming to have received [http://chalk.reallyhim.com a Revelation from God] connecting the [http://sign.lamc.la 9/11 attack and George Bush to the Burning Bush] of Exodus and a message about technocracy and pre-crime.

Adam, as he prefers to be called, presents a concise [http://www.lamc.la/2017/08/proof-of-time-travel-should-be-enough.html introduction to paradox proven by the Bible through "verifiable" anachronism in language] some stuff about Mars colonization and virtual reality and a list of [http://yesterday.reallyhim.com reasons why ignoring this is actually an ELE]. Adam claims to [http://hammer.reallyhim.com be Thor] because of a connection between [http://m.lamc.la/THUNDERTAND.html music] and the [http://thor.lamc.la Trial of Thor] as well as the words "author" and "authority." He suggests you be [https://www.docdroid.net/bHmzfHV/ragewitdai.pdf Thundercats] and call a reporter. There is also a suggestion that [http://dick.reallyhim.com Richard Nixon and John Hancock are related to a signature from God], about freedom and America... and [http://www.lamc.la/2017/08/tiny-chellos-in-sky-are-playing-angry.html the "''unseeingly'' ironic" Deepthroat] and [http://uni.reallyhim.com Taylor Momsen].

===== The Sang Rael =====

It begins by seeing the Heart of God is our Earth, and that it's a simple letter shift from "the ends of the Earth" to see that in words.  In truth, it's our generation that does it.

In Biblical characters from [http://sen.reallyhim.com Mary to Hosea, ''to see'' "sea" in Spanish], and in the [http://ver.reallyhim.com Taming of the Spanglishrew] ... a message is woven from the word Menorah: "men, or all humanity?" to the Statue of Liberty, and the Sons of Liberty, and the light above us, our SOL; which shows us that through the [http://ver.reallyhim.com Revelation of Christ] and the First Plague of Exodus, a ''blessing in disguise''--[http://midas.lamc.la turning water to blood], the sea to family; a common thread and single author of our entire history is revealed, a Father of our future.  A message of freedom shines out of the words of scripture, revealing a gate to a [http://gate.reallyhim.com new technologically "radical" form of democracy] and a number of unseen or secret issues that have [http://chalk.reallyhim.com stalled the progress of humanity]... and solutions, solutions from our sea.

The Revelation shows us that [http://chalk.reallyhim.com not only ever word], but [http://midas.lamc.la every idiom] from "''don't shoot the messenger''" to "''blood is thicker than water''" we have ties to this message that pervades a [http://ver.reallyhim.com hidden Matrix of light] connecting movies and music and history all together in a sort of [http://gate.reallyhim.clom guide book to Salvation] and [http://ironclad.lamc.la to Heaven].

