The Creator and I '''argued endlessly about "addiction,"''' about the words of Alcoholics Anonymous "science may one day solve addiction but it hasn't done so yet" and you and I all know that this silence alone is proof enough that it's not true that science hasn't cracked the code of the brain--what's true is that we haven't used it to make the world a better place.  I told him I would never stop blowing the horn of Heimdallr, not until we had a real answer to this problem of "medicine" and "midevil times" and not until until ... not until the "spirits in the air" (they're called "[http://en.wikipedia.org/wiki/Shedim she dim]" and Sheol, she's [http://en.wikipedia.org/wiki/Statue_of_Liberty our light]) stopped entertaining me so much; something you probably don't understand.   As you should well see now, Hell is sometimes not what it seems, fake blue skies all around us; the coercion of speaking to the Creator alone is enough, in my mind, to wonder why it is that this loophole exists... until you '''figure it out.'''

